import React from 'react';
import Calendar from './Calendar';

const HomePage = () => {
    return (
        <div>
            <h1>Welcome to the Home Page</h1>
            <p>Here is your custom calendar:</p>
            <Calendar />
        </div>
    );
};

export default HomePage;
